async function main() {

  const asset = args[0]
  const usdAmount = args[1]
  const account_id = args[2]

  const amount = await buyAsset()

  return Functions.encodeUint256(amount)

  async function buyAsset() {

    const getAssetPrice = Functions.makeHttpRequest({
      method: 'GET',
      url: `https://data.alpaca.markets/v2/stocks/bars/latest?symbols=${asset}`,
      headers: {
        accept: 'application/json',
        'APCA-API-KEY-ID': 'AK8Y4TWWDJVERKIBS7F8',
        'APCA-API-SECRET-KEY': 'v4HMsmcK3639PiP1suBC6nCYeTFZHF6dk77gdfZM'
      }
    })

    const res = await getAssetPrice;

    const assetPriceUsd = res.data.bars[asset].c;

    // Primero, pasar usdAmount a float si no lo es
    const usdAmountFloat = parseFloat(usdAmount / 1e18); // Ej: 100 dólares

    // assetsToBuy = usdAmount / precio de la acción
    const assetsToBuy = usdAmountFloat / assetPriceUsd;

    const alpacaRequestBuyAsset = Functions.makeHttpRequest({
      method: 'POST',
      url: `https://broker-api.sandbox.alpaca.markets/v1/trading/accounts/${account_id}/orders`,
      headers: {
        accept: 'application/json', 
        'content-type': 'application/json',
        authorization: 'Basic ' + btoa(`CKFCQ4JE4UJU4F2CKT37:GcbMMXbaJYd6Ya7zTRZRkubvW1GC274302rZKkJr`)
      },
      data: {
        side: 'buy',
        type: 'market',
        time_in_force: 'day',
        commission_type: 'notional',
        symbol: asset,
        qty: assetsToBuy.toFixed(2), // Redondear a 2 decimales
      }
    })

    const response = await alpacaRequestBuyAsset
    console.log(response)

    if (!response || response.status !== 200 || !response.data?.bars?.[asset]) {
      return 0
    } else {
      return assetsToBuy * 1e18
    }    
  }
}

const result = await main()
return result

